import React from 'react'
import '../container/leftdiv.css';
import './logo.png';
function Leftdiv() {
  return (
    <div className='left'>
           
           <img id='logo' src={logo} alt="Logo" />
            <h1 id='course-name'>Data Science</h1>
            <div id='course-item'>
              course materials
            </div>
  </div>

  )
}

export default Leftdiv
